script: |
  super -f text -I q128.spq | sort > q128.out

inputs:
  - name: q128.spq
    data: |
      SELECT ALL col0 * + + 68 + + col2 + + ( + + ( col0 ) ) - - - 80 * - - col1 + - ( + 48 ) * col0 + - col1 + - + 47 AS col1 FROM tab2 (FORMAT parquet) AS cor0;
  - name: tab2

outputs:
  - name: q128.out
    data: |
      -3189
      -3841
      -4900
